const TypeAdd = () => {
    const House_API = "http://26.90.237.200:3000/admin/house_type/add";
    const navigate = useNavigate();
    
    const [newName, setNewName] = useState("");
    const [newUsableArea, setNewUsableArea] = useState("");
    const [newStartPrice, setNewStartPrice] = useState("");
  
    const addHouseType = async () => {
      const data = {
        newName: newName,
        newUsableArea: newUsableArea,
        newStartPrice: newStartPrice
      };
  
      try {
        const response = await axios.post(House_API, data);
        console.log(response.data);
        navigate('/Housing');
      } catch (error) {
        console.error(error);
        navigate('/Housing');
      }
    };
  
    return (
      <div>
        <form>
          <div className="form-group">
            <label>ชื่อใหม่</label>
            <input
              type="text"
              className="form-control"
              value={newName}
              onChange={(e) => setNewName(e.target.value)}
            />
          </div>
          <div className="form-group">
            <label>พื้นที่ใช้สอยใหม่</label>
            <input
              type="text"
              className="form-control"
              value={newUsableArea}
              onChange={(e) => setNewUsableArea(e.target.value)}
            />
          </div>
          <div className="form-group">
            <label>ราคาเริ่มต้นใหม่</label>
            <input
              type="text"
              className="form-control"
              value={newStartPrice}
              onChange={(e) => setNewStartPrice(e.target.value)}
            />
          </div>
  
          <button type="button" className="btn btn-primary" onClick={addHouseType}>
            เพิ่มข้อมูล
          </button>
        </form>
      </div>
    );
  };
  
  export default TypeAdd;
